import "./App.css";
import Header from "./Header";
import Homepage from "./Homepage";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path="/gcp_resources"></Route>
        </Switch>
      </Router>
      <Header></Header>
      <Homepage></Homepage>
    </div>
  );
}

export default App;
